(16, 1, '2020-06-08 08:16:37', '2020-06-08 08:16:37', '<!-- wp:paragraph -->\n<p>LIR Evolucija je neprofitabilna, nevladina razvojna, konsultantska i istraživačka agencija, kvalifikovana da radi na različitim aspektima ekonomskog razvoja, upravljanjem i zaštitom okoline i energetske efikasnosti.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>LIR Evolucija &nbsp;je osnovana 22.11.2012. godine i &nbsp;pravni je nasljednik LIR - Lokalna Inicijativa Razvoja - osnovane u Banjoj Luci 4.6.2003. godine.</p>\n<!-- /wp:paragraph -->', 'O nama', '', 'publish', 'closed', 'closed', '', 'o-nama', '', '', '2020-06-09 07:38:40', '2020-06-09 07:38:40', '', 0, 'http://localhost/lir_evolution/?page_id=16', 0, 'page', '', 0),
