(98, 1, '2020-06-09 07:38:39', '2020-06-09 07:38:39', '<!-- wp:paragraph -->\n<p>LIR Evolucija je neprofitabilna, nevladina razvojna, konsultantska i istraživačka agencija, kvalifikovana da radi na različitim aspektima ekonomskog razvoja, upravljanjem i zaštitom okoline i energetske efikasnosti.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>LIR Evolucija &nbsp;je osnovana 22.11.2012. godine i &nbsp;pravni je nasljednik LIR - Lokalna Inicijativa Razvoja - osnovane u Banjoj Luci 4.6.2003. godine.</p>\n<!-- /wp:paragraph -->', 'O nama', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2020-06-09 07:38:39', '2020-06-09 07:38:39', '', 16, 'http://localhost/lir_evolution/2020/06/09/16-revision-v1/', 0, 'revision', '', 0),
(99, 1, '2020-06-09 07:58:41', '2020-06-09 07:58:41', '{\n    \"freddo_theme_options[_onepage_title_aboutus]\": {\n        \"value\": \"O NAMA\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2020-06-09 07:58:41\"\n    },\n    \"freddo_theme_options[_onepage_linkbutton_aboutus]\": {\n        \"value\": \"\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2020-06-09 07:58:05\"\n    },\n    \"freddo_theme_options[_onepage_textbutton_aboutus]\": {\n        \"value\": \"Vi\\u0161e Informacija\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2020-06-09 07:58:41\"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', '95914e4e-7af0-4f02-905b-88201132e8d5', '', '', '2020-06-09 07:58:41', '2020-06-09 07:58:41', '', 0, 'http://localhost/lir_evolution/?p=99', 0, 'customize_changeset', '', 0),
(40, 1, '2020-06-08 09:36:54', '2020-06-08 09:36:54', '<!-- wp:paragraph -->\n<p>LIR Evolucija je neprofitabilna, nevladina razvojna, konsultantska i istraživačka agencija, kvalifikovana da radi na različitim aspektima ekonomskog razvoja, upravljanjem i zaštitom okoline i energetske efikasnosti.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>LIR Evolucija &nbsp;je osnovana 22.11.2012. godine i &nbsp;pravni je nasljednik LIR - Lokalna Inicijativa Razvoja - osnovane u Banjoj Luci 4.6.2003. godine.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>LIR ima dugogodišnje iskustvo u identifikaciji, projektovanju i provođenju integrisanih i razvojnih projekata finansiranih od strane Evropske Unije i drugih donatora.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>LIR-ovi konsultanti posjeduju veliko iskustvo u poslovnom razvoju, razvoju ruralnog područja i poljoprivrede, energetske efikasnosti, upravljanja otpadom i zaštitom okoline. Znanja koje posjeduju u gore navedenim oblastima su usklađena sa standardima, regulativama i direktivama Evropske Unije.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>MISIJA LIR-a je da provodi i koordiniše razvojne projekte i da pruža konsultantske usluge u cilju postizanja održivog razvoja koji se temelji na ostvarivanju balansa između ekonomske i energetske efikasnosti i očuvanja okoline.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>LIR VIZIJA - Razvojna agencija je najbolji instrument koji građani, poslovi, poslovna udruženja i nevladine organizacije mogu da koriste za ekonomsko i socijalno unapređenje. - Konsultantske i razvojne usluge pomažu klijentima u različitim industrijskim granama da na kompetentnim, i za okolinu najboljim načinima, unaprijede ekonomsku efikasnost, zaštite okolinu i sačuvaju energiju. &nbsp; &nbsp;</p>\n<!-- /wp:paragraph -->', 'O nama', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2020-06-08 09:36:54', '2020-06-08 09:36:54', '', 16, 'http://localhost/lir_evolution/2020/06/08/16-revision-v1/', 0, 'revision', '', 0),
